// Core
import React from "react";
import { DharmaLaxalt } from "../../_svg/DharmaLaxalt";

// Styles
import {
  InteractiveFrameHeaderClassName,
  InteractiveFrameHeaderStyle,
} from "./styles.scss";

// Begin Component
// ______________________________________________________________________________

// Begin Types
// __________________________________________________________________________________________

type LXLT_InteractiveFrameHeader = {};

// Begin Component
// _________________________________________________________________________________________

/**
 *
 * @name InteractiveFrameHeader
 * @author Peter Laxalt
 *
 */
export const InteractiveFrameHeader: React.FunctionComponent<LXLT_InteractiveFrameHeader> = () => (
  <InteractiveFrameHeaderStyle className={`${InteractiveFrameHeaderClassName}`}>
    {/* ______________________________________________ */}
    {/* Inner Grid */}
    <div className={`###__inner`}>
      {/* ______________________________________________ */}
      {/* Frame */}
      <div className={`###__frame`}>
        <div className={`###__frame--top`}>TOP ITEMS</div>
        <div className={`###__frame--right`}>RIGHT ITEMS</div>
        <div className={`###__frame--bottom`}>BOTTOM ITEMS</div>
        <div className={`###__frame--left`}>LEFT ITEMS</div>
      </div>

      {/* ______________________________________________ */}
      {/* Typeface */}
      <div className={`###__type`}>
        <DharmaLaxalt />
      </div>
    </div>
  </InteractiveFrameHeaderStyle>
);

// End Component
// ______________________________________________________________________________
